const Header=(props) => {

  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {

  return (
    <div>
      <p>{props.part} {props.exercises}</p>
    </div>
  )
}

const Content=(props) => {
    const parts = props.parts
    return (
      <div>
        {parts.map((part) => <Part key = {part.id} part={part.name} exercises={part.exercises}></Part>)}
      </div>
    )
}

const Total=(props) => {
  const parts = props.parts
  const total = parts[0].exercises

  const summa = parts.reduce((s,part) => {
    console.log(s.exercises,"WHAT IS GOING ON S")
    console.log(part.exercises,"WHAT IS GOING ON PART")
    console.log(total,"WHAT IS GOING ON TOTAL")
    return s.exercises + part.exercises
  })
  return (
    <div>
      <p>Number of exercises {summa}</p>
    </div>
  )
}

const Course=(props) => {
  const course = props.course
  let total = 0
  return (
    <div>
      <Header course = {course.name}></Header>
      <Content parts = {course.parts}></Content>
      <Total parts={course.parts}></Total>
    </div>
  )
}

const App = () => {
  const course = {
    name: 'Half Stack application development',
    id: 1,
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      },
      {
        name: 'DFA-kurssi',
        exercises: 11,
        id: 4
      }
    ]
  }

  return (
    <div>
      <Course course={course} />
    </div>
  )
}

export default App
